import React, {useState} from 'react';
import {AuthService, signUpData} from "../services/authService";
import {useAppDispatch} from "../redux/store";

const SignUp = () => {
    const [signUpData, setSignUp] = useState<signUpData>({ email: '', password: '', userName: '' });
    const dispatch = useAppDispatch();

    return (
        <section className="sm:w-[400px] w-[250px] h-1/2 flex flex-col justify-center items-center bg-white duration-200 p-5 drop-shadow-[0_35px_35px_rgba(25,93,174,1)] hover:drop-shadow-none">
            <div>
                <input
                    type="text"
                    value={signUpData.email}
                    onChange={(e) => setSignUp({ ...signUpData, email: e.target.value })}
                />
                <input
                    type="text"
                    value={signUpData.password}
                    onChange={(e) => setSignUp({ ...signUpData, password: e.target.value })}
                />
                <input
                    type="text"
                    value={signUpData.userName}
                    onChange={(e) => setSignUp({ ...signUpData, userName: e.target.value })}
                />
                <button onClick={() => dispatch(AuthService.signUp(signUpData))}>Sign Up</button>
            </div>
        </section>
    );
};

export default SignUp;
